    data: |
      SELECT DISTINCT + cor0.col0 AS col2 FROM tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet), tab2 (FORMAT parquet) cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q9583.out
    data: |
      7
      78
      79
